import React from "react";

import s from './HeaderBanner.module.css';
import cn from 'classnames';

const HeaderBanner = () => {
    return (
        <div className={s.wrap}>
            <ul id={s.slides}>
                <li className={cn(s.slide, s.showing)}>Slide 1</li>
                <li className={s.wrap}>Slide 2</li>
                <li className={s.wrap}>Slide 3</li>
                <li className={s.wrap}>Slide 4</li>
                <li className={s.wrap}>Slide 5</li>
            </ul>
        </div>
    );
}

export default HeaderBanner;
